--
-- 資料表結構 `cmscity_code`
--

CREATE TABLE `cmscity_code` (
  `company` char(10) COLLATE utf8_unicode_ci NOT NULL COMMENT '公司名稱',
  `creator` char(10) COLLATE utf8_unicode_ci NOT NULL COMMENT '建立者',
  `usr_group` char(10) COLLATE utf8_unicode_ci NOT NULL COMMENT '使用者群組',
  `create_date` char(8) COLLATE utf8_unicode_ci NOT NULL COMMENT '建立日期',
  `modifier` char(10) COLLATE utf8_unicode_ci NOT NULL COMMENT '修改者',
  `modi_date` char(8) COLLATE utf8_unicode_ci NOT NULL COMMENT '修改日期',
  `flag` float NOT NULL DEFAULT '0' COMMENT '印列次數',
  `cc001` int(11) NOT NULL COMMENT '自動編號',
  `cc002` int(11) NOT NULL DEFAULT '0' COMMENT '父層編號-縣市',
  `cc003` int(11) NOT NULL DEFAULT '0' COMMENT '子層編號-鄉鎮市區',
  `cc004` char(5) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '郵遞區號',
  `cc005` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '中文名稱',
  `cc006` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '英文名稱',
  `date_create` datetime NOT NULL COMMENT '建立日期',
  `date_modify` datetime DEFAULT NULL COMMENT '修改日期',
  `sortby` int(10) NOT NULL DEFAULT '0' COMMENT '排序',
  `status` varchar(10) COLLATE utf8_unicode_ci NOT NULL DEFAULT 'ON' COMMENT '狀態'
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='縣市鄉鎮代碼表';

